import React from 'react';
import { useNavigate } from 'react-router-dom';
import MapWithUpdatingCenter from './MapWithUpdatingCenter';
import 'leaflet/dist/leaflet.css';

const parkingLots = [
  {
    id: 1,
    name: 'Perry Street Garage',
    position: [37.2312, -80.4263],
    availableSpots: 45,
    totalSpots: 120,
    status: 'Some Open',
  },
  {
    id: 2,
    name: 'Cassell Lot',
    position: [37.2214, -80.4205],
    availableSpots: 0,
    totalSpots: 80,
    status: 'Full',
  },
  {
    id: 3,
    name: 'Litton Reaves',
    position: [37.2220, -80.4267],
    availableSpots: 35,
    totalSpots: 60,
    status: 'Available',
  },
  {
    id: 4,
    name: 'Squires',
    position: [37.2291, -80.4168],
    availableSpots: 5,
    totalSpots: 40,
    status: 'Some Open',
  },
  {
    id: 5,
    name: 'Architecture Annex',
    position: [37.2283, -80.4158],
    availableSpots: 20,
    totalSpots: 30,
    status: 'Available',
  },
];

const InteractiveMap = () => {
  const navigate = useNavigate();

  const handleMarkerClick = (id) => {
    // Navigate to the page for the parking lot
    navigate(`/parking-lots/${id}`);
  };

  return (
    <div style={styles.mapContainer}>
      <MapWithUpdatingCenter 
        center={[37.225, -80.423]}
        zoom={14.6}
        markers={parkingLots}
        onMarkerClick={handleMarkerClick}
      />
    </div>
  );
};

const styles = {
  mapContainer: {
    width: '100%',
    height: '100%',
    borderRadius: '4px',
    overflow: 'hidden',
    boxShadow: '0 2px 4px rgba(0, 0, 0, 0.2)',
  },
};

export default InteractiveMap;
